var otpInputElm = "input#otp";
var submitBtnElm = 'form > button[type="submit"]';

// OTP Settings
var otpSe = {
	// otpLength: 4, // OTP Length
  // https://sms.dimonvideo.net/
  userID: "1741fb742356ac77",
};

// All OTP Data
var otpData = [];

// Is Found OTP
var otpNumber = "";

async function timeout(ms) {
  return new Promise(resolve => setTimeout(resolve, parseInt(ms)));
}

// [REQUEST] Get OTP
async function getOTP() {
  return new Promise(async (resolve) => {
  	var fetchOTPURL = "https://sms.dimonvideo.net/index.php?op=6&u="+ otpSe.userID;
    const xhr = new XMLHttpRequest();
    xhr.open("GET", fetchOTPURL, true);
    xhr.onreadystatechange = (e) => {
      if (xhr.readyState == 4) {
        // Parse String to HTML DOM
        var parser = new DOMParser();
        var html = parser.parseFromString("<table>"+ xhr.responseText +"</table>", "text/html");
        // Fetch OTP
        fetchOTPMessageData(html);
        if (otpData.length > 0) {
          resolve(true);
        } else {
          resolve(false);
        }
      }
    }
    xhr.send();
  });
}

// [REQUEST] Delete OTP Message
async function deleteOTP(smsID) {
  return new Promise(async (resolve) => {
		// https://sms.dimonvideo.net/index.php?op=4&id=447185&u=1741fb742356ac77
    // https://sms.dimonvideo.net/index.php?op=4&id=447185&u=1741fb742356ac77
    var fetchOTPURL = "https://sms.dimonvideo.net/index.php?op=4&u="+ otpSe.userID + "&id="+ smsID;
    const xhr = new XMLHttpRequest();
    xhr.open("GET", fetchOTPURL, true);
    xhr.onreadystatechange = (e) => {
      if (xhr.readyState == 4) {
        resolve(true);
      }
    }
    xhr.send();
  });
}

// [METHOD] Fetch OTP in the HTML and Store All OTP in the Variable
function fetchOTPMessageData(html) {
	var rows = html.querySelector("table").rows;
  if (!rows === false && rows.length > 0) {
    for(var i = 0;  i < rows.length; i++) {
      var row = rows[i];
      var isFoundSMSText = row.querySelector("td:nth-child(3) > p:nth-child(2)");
      var isFoundSMSID = row.querySelector("td:nth-child(3) > p:nth-child(1)");
      if (!isFoundSMSText === false && !isFoundSMSText.innerText.trim() === false && !isFoundSMSID.id === false) {
        otpData.push({"text": isFoundSMSText.innerText.trim(), "sms_id": isFoundSMSID.id });
      }
    }
  }
}

// [METHOD] Match OTP in the SMS Text
async function matchOTPInSMSText(otpData) {
  return new Promise(async (resolve) => {
    if (otpData.length > 0) {
      for(var i = 0;  i < otpData.length; i++) {
        var sms = otpData[i];
        if (!sms.text || !sms.sms_id) { continue; }
				var isFoundSixDigthOTP = (sms.text.match(/(^|[^\d])(\d{6})([^\d]|$)/) || [false])[0];
        if (isFoundSixDigthOTP === false) {
        	// console.error("OTP NOT MATCH: "+ sms.text);
        } else {
          // Delete OTP
          await deleteOTP(sms.sms_id);
          return resolve(isFoundSixDigthOTP.replace(/[^0-9]/gi, ''));
          break;
        }
      }
      return resolve(false);
    }
  });
}

(async() => {
  var isFoundOTPData = false;
  var isFoundOTP = false;
  do {
    isFoundOTPData = await getOTP();
    await timeout(1500);
    console.error("OTP DATA NOT FOUND: "+ isFoundOTPData);
    if (isFoundOTPData === true) {
      isFoundOTP = await matchOTPInSMSText(otpData);
      console.error("OTP NOT FOUND: "+ isFoundOTP);
      if (!isFoundOTP === false) {
        document.querySelector(otpInputElm).value = isFoundOTP;
        if (!submitBtnElm === false) {
          // document.querySelector(submitBtnElm).click();
        }
      }
    }
  }
  while (isFoundOTPData === false || isFoundOTP === false);
})();
